/**
 * @param {string} s
 * @param {string} t
 * @return {character}
 */

/*
https://leetcode.com/problems/find-the-difference/

解法:
1. 把兩個字串轉成陣列並排序
2. 迭代 t 並找出不同的值
3. 如果都沒有比較到，表示不同的值在最後一個
*/
let findTheDifference = function (s, t) {
  // 1. 把兩個字串轉成陣列並排序
  let sChars = s.split('').sort();
  let tChars = t.split('').sort();
  let i = 0;
  // 2. 迭代 t 並找出不同的值
  for (i = 0; i < sChars.length; i++) {
    if (tChars[i] !== sChars[i]) {
      return tChars[i];
    }
  }
  // 3. 如果都沒有比較到，表示不同的值在最後一個
  return tChars[i];
}

console.log(findTheDifference("abcd", "abcde")) // "e"
console.log(findTheDifference("",
  "")) // "t"
console.log(findTheDifference('a', 'aa')) // "a"